"use strict";(self.webpackChunkwiki=self.webpackChunkwiki||[]).push([[130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"cue-sheet-converter","metadata":{"permalink":"/blog/cue-sheet-converter","source":"@site/blog/2025-08-01-cue-sheet-converter.md","title":"Cue Sheet Converter (beta)","description":"The Cue Sheet Converter is now available in T\u016blBOX \u2014 a fast, browser-based tool built to simplify the extraction and formatting of music cue sheet data.","date":"2025-08-01T00:00:00.000Z","tags":[],"readingTime":1.46,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Chief Glitch Finder","page":{"permalink":"/blog/authors/zappbrandigan"},"email":"brandon@tulbox.app","imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"slug":"cue-sheet-converter","title":"Cue Sheet Converter (beta)","authors":["zappbrandigan"]},"unlisted":false,"nextItem":{"title":"New Renaming Templates","permalink":"/blog/2025/07/18/pdf-manager"}},"content":"The Cue Sheet Converter is now available in T\u016blBOX \u2014 a fast, browser-based tool built to simplify the extraction and formatting of music cue sheet data.\\n\\nIn music publishing, converting cue sheet PDFs into usable, structured data can be one of the most time-consuming and error-prone tasks in the process. Tracking every episode where a work or composer split appears \u2014 by manually scanning PDFs \u2014 is tedious at best.\\n\\nEnter the Cue Sheet Converter.\\n\\n\x3c!-- truncate --\x3e\\n\\n## What it does\\n\\nThe Cue Sheet Converter takes raw cue sheet files (**PDF**) and transforms them into clean, structured data for easy review and downstream use.\\n\\nNo more manually scanning PDF files line-by-line \u2014 the converter parses the file automatically and outputs a neatly organized table view.\\n\\n## Key features\\n\\n- **Drag-and-drop upload** for quick file selection\\n- **Automatic parsing** of Soundmouse-formatted cue sheets\\n- **Table view** for instant preview of extracted data\\n- **Column metadata mapping** for consistent exports\\n- **Warnings** for missing or unexpected data\\n- **One-click CSV download** for reporting or archiving\\n\\n## How it works\\n\\n1. Upload your cue sheet file.\\n2. The converter scans for titles, writers, publishers, durations, and other key fields.\\n3. Data preview is displayed directly in your browser.\\n4. Export to CSV \u2014 no server processing, so your files stay local and secure.\\n\\n## Why it matters\\n\\nThis tool **alleviates** the tedious PDF-scanning process and reduces the risk of typos or missed metadata.  \\nIt\u2019s especially valuable when linking episodes across **high volumes of cue sheets**.\\n\\n## What\u2019s next\\n\\n- **More formats:** RapidCue and CueSpark support are planned for upcoming releases.\\n\\n---\\n\\n\ud83d\udccd **Try it now** \u2014 open the Cue Sheet Converter from the T\u016blBOX tools menu.  \\nWe\u2019d love to hear your feedback \u2014 use the **Feature Request** link in the footer to share ideas for improvements."},{"id":"/2025/07/18/pdf-manager","metadata":{"permalink":"/blog/2025/07/18/pdf-manager","source":"@site/blog/2025-07-18-pdf-manager.md","title":"New Renaming Templates","description":"A fresh set of regex templates has been added to the Search\u202f&\u202fReplace tool \u2014 making it even easier to format your file names consistently, cleanly, and fast.","date":"2025-07-18T00:00:00.000Z","tags":[],"readingTime":1.06,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Chief Glitch Finder","page":{"permalink":"/blog/authors/zappbrandigan"},"email":"brandon@tulbox.app","imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"title":"New Renaming Templates","authors":"zappbrandigan"},"unlisted":false,"prevItem":{"title":"Cue Sheet Converter (beta)","permalink":"/blog/cue-sheet-converter"},"nextItem":{"title":"CWR Converter (beta)","permalink":"/blog/2025/07/14/cwr-beta-update"}},"content":"A fresh set of **regex templates** has been added to the *Search\u202f&\u202fReplace* tool \u2014 making it even easier to format your file names consistently, cleanly, and fast.\\n\\nThese new templates are designed to pair seamlessly with the existing **Cue Sheet** presets. Whether you\u2019re converting date formats, reordering titles, or applying final polish to naming conventions, these tools can now handle it in a click.\\n\\n\x3c!-- truncate --\x3e\\n\\n## What\u2019s New\\n\\nHere are the new built-in templates:\\n\\n* **Cue Sheet T1**  \\n  The original `CUE_SHEET_TEMPLATE` has been renamed.\\n\\n* **Cue Sheet T2**  \\n  Same as the original, but designed for file names that do not have an episode title.\\n\\n* **Date Conversion 1**  \\n  `011425` \u2192 `14012025` (6-digit \u2192 U.S. format)\\n\\n* **Date Conversion 2**  \\n  `01142025` \u2192 `14012025` (8-digit \u2192 U.S. format)\\n\\n* **Add \u201cEp No.\u201d**  \\n  `011425` \u2192 `Ep No. 011425`\\n\\n* **Reorder Tokens**  \\n  ```\\n  Prod Title - 104 - Ep Title \u2192 Prod Title   Ep Title  Ep No. 104\\n  ```\\n\\n* **Zero Pad Episode Suffix**  \\n  `Ep No. 113` \u2192 `Ep No. 1013`\\n\\n## Tips for Use\\n\\n* Combine multiple templates in a row to streamline complex renaming tasks.\\n* Use the general templates *before* applying cue sheet rules for best results.\\n\\n## Read the Docs\\n\\nYou\u2019ll find a new guide in the docs titled **Regex Templates**, which walks through each of these rules with examples and usage notes.\\n\\n[\u2192 View the Regex Templates Guide](/pdf-manager/templates)"},{"id":"/2025/07/14/cwr-beta-update","metadata":{"permalink":"/blog/2025/07/14/cwr-beta-update","source":"@site/blog/2025-07-14-cwr-beta-update.md","title":"CWR Converter (beta)","description":"The CWR Converter is now part of T\u016blBOX \u2014 a browser-based tool that makes it easy to view, search, and report on Common Works Registration (CWR) files without specialized software.","date":"2025-07-14T00:00:00.000Z","tags":[],"readingTime":2,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Chief Glitch Finder","page":{"permalink":"/blog/authors/zappbrandigan"},"email":"brandon@tulbox.app","imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"title":"CWR Converter (beta)","authors":"zappbrandigan"},"unlisted":false,"prevItem":{"title":"New Renaming Templates","permalink":"/blog/2025/07/18/pdf-manager"},"nextItem":{"title":"Production Search Update","permalink":"/blog/2025/07/02/imdb-update"}},"content":"The CWR Converter is now part of T\u016blBOX \u2014 a browser-based tool that makes it easy to view, search, and report on Common Works Registration (CWR) files without specialized software.\\n\\nTraditionally, analyzing CWR files has been a slow, technical process, often requiring command-line tools, custom scripts, or manual spreadsheet work. Even small tasks \u2014 like verifying writer shares or matching works across submissions \u2014 could mean hours of scrolling through raw text.\\n\\nThe CWR Converter is removing those barriers, allowing you to open files directly in your browser, search instantly, and generate detailed reports in seconds.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n## Performance & Scale\\n\\n| New Tech | What it solves |\\n| -------- | -------------- |\\n| **Virtualized Raw Viewer & Report Tables** | Rows render only when visible, so even 100 k-line CWRs stay buttery smooth. |\\n| **Web Workers** | Parsing now runs off the main thread, keeping the UI responsive\u2014even with 100 MB+ files. |\\n\\n*Result: can now handle large transmissions, but capped at `~100 Mb` to accomodate lower-end systems capabilites.*\\n\\n---\\n\\n## Smarter, Highlighted Search\\n\\nFind that elusive record in seconds:\\n\\n* **Unified search bar** works across the virtualized viewer.  \\n* **Live highlighting** pins every match in-view as you type.  \\n* **Next / Previous** arrows (or shortcuts below) cycle through matches and auto-scroll.\\n\\n---\\n\\n## Pseudo Full-Screen Raw Viewer\\n\\nNeed extra space? Hit **`\u2318/Ctrl + e`** or click the new \u201cexpand\u201d icon to pop the Raw Viewer into a focused, edge-to-edge mode. Perfect for side-by-side edits.\\n\\n---\\n\\n## Field Tooltips \u2192 Now Toggleable\\n\\nMouse-over labels still reveal field names & definitions, but if you already know your **SPU** from your **SWR**, press **`\u2318/Ctrl + k`** to hide them and reclaim that bit of horizontal room.\\n\\n---\\n\\n## Shortcut Recap\\n\\n| Action | macOS / Windows |\\n| ------ | --------------- |\\n| Toggle Search | `\u2318/Ctrl + f` |\\n| Expand / Collapse Raw Viewer | `\u2318/Ctrl + e` |\\n| Toggle Tooltips | `\u2318/Ctrl + k` |\\n| Next / Prev Match | `\u2318/Ctrl + \u2193` \u2022 `\u2318/Ctrl + \u2191` |\\n\\n(You\u2019ll find them in the in-app **?** menu too.)\\n\\n---\\n\\n## Miscellaneous Fixes\\n\\n* Batch report now includes **dynamic** writer contribution calculations.\\n* AKA report now lists **unique** titles only.  \\n* NAT record support added via updated **cwr-parser**.  \\n* Copy-paste from AKA titles preserves correct column order.  \\n* PDF export no longer fails when template contains empty header cells.  \\n* Minor visual polish & accessibility improvements.\\n\\n---\\n\\n## Try it & tell me what breaks\\n\\nThe beta is live at **T\u016blBOX \u2192 CWR Converter**. As always, this release is best served with fresh feedback:\\n\\n*Found a glitch?* Copy the **Bug Entry Template** from the docs and add it to the tracker\u2014or hit the footer\u2019s \u201cReport a Bug\u201d link.\\n\\nHappy converting!"},{"id":"/2025/07/02/imdb-update","metadata":{"permalink":"/blog/2025/07/02/imdb-update","source":"@site/blog/2025-07-02-imdb-update.md","title":"Production Search Update","description":"Here is quick update about some recent changes to the Production Search tool on Tu\u0304lBOX! This update focuses on improving data clarity and fixing some annoying copy-paste quirks. Here\u2019s what\u2019s new:","date":"2025-07-02T00:00:00.000Z","tags":[],"readingTime":0.94,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Chief Glitch Finder","page":{"permalink":"/blog/authors/zappbrandigan"},"email":"brandon@tulbox.app","imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"title":"Production Search Update","authors":["zappbrandigan"]},"unlisted":false,"prevItem":{"title":"CWR Converter (beta)","permalink":"/blog/2025/07/14/cwr-beta-update"},"nextItem":{"title":"Tu\u0304lBOX V3","permalink":"/blog/tulbox"}},"content":"Here is quick update about some recent changes to the Production Search tool on Tu\u0304lBOX! This update focuses on improving data clarity and fixing some annoying copy-paste quirks. Here\u2019s what\u2019s new:\\n\\n\x3c!-- truncate --\x3e\\n\\n#### Country of Origin Now Included\\n\\nYou can now see the country of origin listed alongside each title. This makes it easier to distinguish between international versions of a film or series at a glance\u2014especially helpful for teams handling global metadata.\\n\\n#### Alternative Titles Copy-Paste Fix\\n\\nPreviously, copying alternative titles would result in the order being scrambled or inconsistent. That\u2019s now fixed. The tool preserves the display order exactly as shown when copying, so what you see is what you get.\\n\\n#### IMDb Code Copy Trimmed to Last 9 Characters\\n\\nI\'ve cleaned up the IMDb code copy behavior. Instead of copying the full URL or extra characters, it now smartly copies just the last 9-character IMDb ID (e.g.,tt12345678 -> t12345678)\u2014perfect for pasting into internal systems. (This change may be reverted in the future.)\\n\\n\u2e3b\\n\\nThese updates are live now. As always, feel free to reach out with feature suggestions or bugs. More improvements coming soon!"},{"id":"tulbox","metadata":{"permalink":"/blog/tulbox","source":"@site/blog/2025-06-12-tulbox.md","title":"Tu\u0304lBOX V3","description":"Tu\u0304lBOX v3 is officially live!","date":"2025-06-12T00:00:00.000Z","tags":[],"readingTime":0.73,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Chief Glitch Finder","page":{"permalink":"/blog/authors/zappbrandigan"},"email":"brandon@tulbox.app","imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"slug":"tulbox","title":"Tu\u0304lBOX V3","authors":["zappbrandigan"]},"unlisted":false,"prevItem":{"title":"Production Search Update","permalink":"/blog/2025/07/02/imdb-update"}},"content":"**Tu\u0304lBOX v3** is officially live!\\n\\nThis release brings a smoother experience, sharper performance, and improved APIs. The existing tools have been refined based on feedback from real-world use and the entire app has been rebuilt from the ground up. It is now ready to host additional tools as they get released!\\n\\n\x3c!-- truncate --\x3e\\n\\n### What\u2019s New in v3\\n\\n* **Improved Speed** \u2013 Apps load faster and respond more smoothly.\\n* **Cleaner UI** \u2013 Redesigned the tools for clarity and flexibility.\\n* **More Reliable Automation** \u2013 Updated Web Workers to handle complex files more gracefully.\\n* **Better Metadata Handling** \u2013 The Production Search tool has a custom built API.\\n\\n### Why This Matters\\n\\nThis update makes it easier to add new tools that are in the works, such as CWR conversion and automated cue sheet stamping.\\n\\nThis is a 00 release, so there will be blood! I mean bugs. Reach out if you run into anything weird."}]}}')}}]);